import React from "react";
import '../../assets/countries.css';
import {Link} from "react-router-dom";
import '../../containers/Home';
import '../../containers/Favorites';
import IM from "../../assets/img"


const PlacesHeader = () => {
  return (
    <>
      <header>
        <div classname="places-header">
          <div className="header">
            <nav className="navbar">
              <div className="logo">
                <Link title="home" to="/Home"><img src={ IM } alt="Icon" /></Link>
                <Link title="home" to="/Home"> Around The World </Link>
              </div>
              <Link className="favorites" to="/Favorites"> Favorites </Link>
            </nav>
          </div>
        </div>    
      </header>
    </>
  );
}

export default PlacesHeader;
